package practice;

public class swapmethod1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=20;
		int c;
		c=b;
		b=a;
		a=c;
		
		
		System.out.println(a);
		System.out.println(b);
		
		int a1=10;
		int b1=20;
		
		a1=a1+b1;
		b1=a1-b1;
		a1=a1-b1;
		
		System.out.println(a1);
		System.out.println(b1);
		
				

	}

}
